import './App.css';

import Category1 from './Category1';
import Category2 from './Category2';
import Category3 from './Category3';
// colors 90A8ED FF90E8 FFC900 23A094
function App() {
  return (
    <div className = ' relative w-screen h-screen bg-[#E5FAFF]'>
      <div>
        <Category1 data-index="0" data-status="active"/>
        <Category2 data-index="1" data-status="inactive"/>
      </div>
    </div>
  );
}

export default App;
